import React from 'react';

// Define the data for courses, websites, books, clubs, and their respective images
const resources = {
  courses: [
    { name: "Full Stack Development - (Dr. Jones)", image: "https://example.com/fullstack.jpg" },
    { name: "Intro to C++", image: "https://example.com/cpp.jpg" },
    { name: "Building upon Python", image: "https://example.com/python.jpg" }
  ],
  websites: [
    { name: "replit.com", image: "https://example.com/replit.jpg" },
    { name: "GeeksforGeeks.org", image: "https://example.com/geeks.jpg" },
    { name: "google.com", image: "https://example.com/google.jpg" }
  ],
  books: [
    { name: "Python Distilled", image: "https://example.com/pydistilled.jpg" },
    { name: "How to Become a Better Coder", image: "https://example.com/bettercoder.jpg" },
    { name: "Do I Really Love This?", image: "https://example.com/dolove.jpg" }
  ],
  clubs: [
    { name: "Mathmatic Club", image: "https://example.com/mathclub.jpg" },
    { name: "I Love To Code, Club", image: "https://example.com/codelove.jpg" },
    { name: "I hate to Code, Club", image: "https://example.com/codehate.jpg" }
  ]
};

// The Sophmore component
export const Sophmore = () => {
  return (
    <div style={{ textAlign: 'center' }}>
      <h1>Sophmores, Welcome to Year 2! You are Half Way There!</h1>
    </div>
  );
}

// Main component that includes Sophmore and additional resources
const MainComponent = () => {
  return (
    <div style={{ textAlign: 'center' }}>
      <Sophmore />
      <div className="resources">
        <h2>Courses to Take</h2>
        <ul>
          {resources.courses.map(course => (
            <li key={course.name}>
              {course.name}
              <img src={course.image} alt={course.name} style={{ width: '100px', height: '100px' }} />
            </li>
          ))}
        </ul>

        <h2>Websites to Use</h2>
        <ul>
          {resources.websites.map(site => (
            <li key={site.name}>
              {site.name}
              <img src={site.image} alt={site.name} style={{ width: '100px', height: '100px' }} />
            </li>
          ))}
        </ul>

        <h2>Books to Read</h2>
        <ul>
          {resources.books.map(book => (
            <li key={book.name}>
              {book.name}
              <img src={book.image} alt={book.name} style={{ width: '100px', height: '100px' }} />
            </li>
          ))}
        </ul>

        <h2>Clubs/Extracurriculars</h2>
        <ul>
          {resources.clubs.map(club => (
            <li key={club.name}>
              {club.name}
              <img src={club.image} alt={club.name} style={{ width: '100px', height: '100px' }} />
            </li>
          ))}
        </ul>
      </div>
    </div>
  );
}

export default MainComponent;
